window.bookSummaryJSON = "<p>In <i>The 10X Mentor</i>, available exclusively in audio via Audible, Grant Cardone—business titan, entrepreneur, real estate mogul, <i>New York Times</i> best-selling author, thought leader, philanthropist, and founder of the 10X Growth Conference—takes listeners underwing to teach them the fundamentals of his success, and not just modest success: We’re talking 10X success. </p> <p>He will give you his signature takes on how to:</p> <p></p> <ul> <li>Commit</li> <li>Set goals</li> <li>Get known</li> <li>Create a narrative about yourself</li> <li>Connect</li> <li>Improve</li> <li>Motivate</li> <li>Create multiple streams of income</li> <li>Go big or go bigger</li> <li>Create wealth</li> <li>Market yourself</li> <li>Choose great partners</li> <li>Get rid of the people, places, and things that no longer serve you</li> <li>Execute</li> <li>Follow-up</li> <li>Deal with setbacks</li> <li>Assess your business and your team</li> <li>Turn liabilities into assets</li> <li>Give back</li> </ul> <p><i>The 10X Mentor</i> offers a unique opportunity to get the 10X message directly from its source. With lively illustrations from his own considerable business experience, Cardone will guide listeners in setting high goals—higher than they might have previously imagined—and then he’ll teach them exactly what they need to do to achieve them. </p>"; 
